Unreal Imagination - this is a completely new look at Skyrim.
When all try to make photorealistic graphic in Skyrim, I suggest you look at the power of imagination.
Believe in the story and go to meet adventures.

Unreal Imagination is based on the seemingly incompatible graphic mods:
- ENBSeries v0.103
- FXAA v2.1

 What\'s new in version 5.0:
- New assembly.
- Used latest build ENBSeries  and FXAA.
- Fixed contrast and colorful.
- Improved performance.


//++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++
//INSTALLING:
//++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++++
Extract files from archive in to the game directory or where game execution file exist (.exe).
Run game launcher to reconfigure it again.
